import React from "react";
import { Link } from "react-router-dom";

function HeaderDate() {
  const headerData = [
    {
      title: "THIS WEEK",
      to: "/bookings/thisweek",
    },
    {
      title: "NEXT WEEK",
      to: "/bookings/nextweek",
    },
    {
      title: "WHOLE MONTH",
      to: "/bookings/wholemouth",
    },
  ];
  return (
    <div>
      <ul>
        {headerData.map((el) => (
          <Link to={el.to}>
            <li>{el.title}</li>
          </Link>
        ))}
      </ul>
    </div>
  );
}

export default HeaderDate;
